<!DOCTYPE html>
<html lang="es">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>AEMX Â· Editor de Marco</title>
  <link href="https://fonts.googleapis.com/css2?family=Orbitron:wght@400;700;900&family=Rajdhani:wght@400;600;700&display=swap" rel="stylesheet">
  <style>
    :root {
      --bg: #060b14; --panel: #0b1626; --border: #1a3a5c;
      --glow: #00c8ff; --glow2: #00ff9d; --text: #cce4ff; --text2: #6b8ab0;
    }
    * { box-sizing: border-box; margin: 0; padding: 0; }
    body {
      background: var(--bg); color: var(--text);
      font-family: 'Rajdhani', sans-serif;
      min-height: 100vh; display: flex; flex-direction: column;
      align-items: center; padding: 24px 16px 48px; gap: 20px;
    }
    body::before {
      content: ''; position: fixed; inset: 0;
      background-image:
        linear-gradient(rgba(0,200,255,0.03) 1px, transparent 1px),
        linear-gradient(90deg, rgba(0,200,255,0.03) 1px, transparent 1px);
      background-size: 40px 40px; pointer-events: none; z-index: 0;
    }
    h1 {
      font-family: 'Orbitron', monospace; font-size: clamp(14px,3vw,20px);
      font-weight: 900; letter-spacing: 4px; color: var(--glow);
      text-shadow: 0 0 20px rgba(0,200,255,0.5); position: relative; z-index: 1;
    }
    h1 span { color: #facc15; }
    .controls {
      display: flex; gap: 12px; flex-wrap: wrap; justify-content: center;
      background: var(--panel); border: 1px solid var(--border);
      border-radius: 12px; padding: 14px 20px; position: relative; z-index: 1;
    }
    .control-group { display: flex; flex-direction: column; align-items: center; gap: 6px; }
    .control-label {
      font-family: 'Orbitron', monospace; font-size: 8px;
      letter-spacing: 2px; color: var(--text2); text-transform: uppercase;
    }
    .color-row { display: flex; align-items: center; gap: 8px; }
    input[type="color"] {
      width: 42px; height: 42px; border-radius: 8px;
      border: 2px solid var(--border); background: none; cursor: pointer; padding: 2px;
    }
    input[type="color"]:hover { border-color: var(--glow); }
    .color-swatch {
      width: 18px; height: 18px; border-radius: 50%;
      border: 2px solid rgba(255,255,255,0.2); flex-shrink: 0;
    }
    input[type="range"] { width: 90px; accent-color: var(--glow); }
    .tol-val { font-size: 10px; color: var(--text2); font-family: monospace; }
    .btn {
      font-family: 'Orbitron', monospace; font-size: 9px; font-weight: 700;
      letter-spacing: 2px; padding: 9px 16px; border-radius: 8px;
      border: 1px solid var(--glow); background: rgba(0,200,255,0.08);
      color: var(--glow); cursor: pointer; transition: all 0.2s; white-space: nowrap;
    }
    .btn:hover { background: var(--glow); color: #060b14; box-shadow: 0 0 20px rgba(0,200,255,0.4); }
    .btn.upload { border-color: #facc15; color: #facc15; background: rgba(250,204,21,0.08); }
    .btn.upload:hover { background: #facc15; color: #060b14; }
    .btn.download { border-color: var(--glow2); color: var(--glow2); background: rgba(0,255,157,0.08); }
    .btn.download:hover { background: var(--glow2); color: #060b14; }
    .editor-wrap {
      position: relative; width: min(500px, 92vw); height: min(500px, 92vw);
      border-radius: 6px; overflow: hidden; z-index: 1;
      box-shadow: 0 0 50px rgba(0,200,255,0.12), 0 20px 60px rgba(0,0,0,0.7);
      cursor: pointer;
    }
    #photo-layer {
      position: absolute; inset: 0; background: #0d0d0d;
      display: flex; align-items: center; justify-content: center;
      flex-direction: column; gap: 10px;
    }
    #photo-layer img {
      position: absolute; inset: 0; width: 100%; height: 100%; object-fit: cover;
    }
    .upload-hint {
      display: flex; flex-direction: column; align-items: center; gap: 10px;
      pointer-events: none; z-index: 1; opacity: 0.4;
    }
    .upload-hint p {
      font-family: 'Orbitron', monospace; font-size: 9px;
      letter-spacing: 2px; color: var(--text2);
    }
    #frame-canvas {
      position: absolute; inset: 0; width: 100%; height: 100%;
      pointer-events: none; z-index: 2;
    }
    #logo-overlay {
      position: absolute; top: -2%; left: 50%; transform: translateX(-50%);
      width: 30%; pointer-events: none; z-index: 3;
    }
    .editor-wrap.dragover { outline: 2px dashed var(--glow); outline-offset: -4px; }
    .divider { width: 1px; height: 60px; background: var(--border); align-self: center; }
    .hint { font-size: 11px; color: var(--text2); letter-spacing: 1px; position: relative; z-index: 1; }
  </style>
</head>
<body>

<h1>MARCO <span>AEMX</span></h1>

<div class="controls">
  <div class="control-group">
    <div class="control-label">Marco MetÃ¡lico</div>
    <div class="color-row">
      <div class="color-swatch" id="swatch1" style="background:#c8ccc0"></div>
      <input type="color" id="color1" value="#c8ccc0">
    </div>
  </div>
  <div class="control-group">
    <div class="control-label">Detalles Cyan</div>
    <div class="color-row">
      <div class="color-swatch" id="swatch2" style="background:#50add8"></div>
      <input type="color" id="color2" value="#50add8">
    </div>
  </div>
  <div class="control-group">
    <div class="control-label">Borde Oscuro</div>
    <div class="color-row">
      <div class="color-swatch" id="swatch3" style="background:#1a1f26"></div>
      <input type="color" id="color3" value="#1a1f26">
    </div>
  </div>
  <div class="divider"></div>
  <div class="control-group">
    <div class="control-label">Rango Marco</div>
    <input type="range" id="tol1" min="5" max="150" value="80">
    <div class="tol-val" id="tol1-val">80</div>
  </div>
  <div class="control-group">
    <div class="control-label">Tolerancia Cyan</div>
    <input type="range" id="tol2" min="10" max="150" value="70">
    <div class="tol-val" id="tol2-val">70</div>
  </div>
  <div class="control-group">
    <div class="control-label">Umbral Oscuro</div>
    <input type="range" id="tol3" min="10" max="120" value="50">
    <div class="tol-val" id="tol3-val">50</div>
  </div>
  <div class="divider"></div>
  <div class="control-group">
    <div class="control-label">Tu Foto</div>
    <label class="btn upload" for="photo-input">ðŸ“· SUBIR</label>
    <input type="file" id="photo-input" accept="image/*" style="display:none">
  </div>
  <div class="control-group">
    <div class="control-label">Exportar PNG</div>
    <button class="btn download" onclick="descargar()">â¬‡ GUARDAR</button>
  </div>
</div>

<div class="editor-wrap" id="editor-wrap">
  <div id="photo-layer">
    <div class="upload-hint" id="upload-hint">
      <svg width="52" height="52" viewBox="0 0 24 24" fill="none" stroke="#cce4ff" stroke-width="1.2">
        <rect x="3" y="3" width="18" height="18" rx="2"/>
        <circle cx="8.5" cy="8.5" r="1.5"/>
        <polyline points="21,15 16,10 5,21"/>
      </svg>
      <p>ARRASTRA O SUBE TU FOTO</p>
    </div>
  </div>
  <canvas id="frame-canvas"></canvas>
  <img id="logo-overlay" alt="AEMX Logo">
</div>

<p class="hint">Haz clic en el editor para subir una foto Â· Ajusta los colores con los controles</p>

// â”€â”€ Colores originales muestreados del marco â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
const ORIG = {
  gray: { r: 149, g: 162, b: 162 },
  cyan: { r:  73, g: 118, b: 139 },
  dark: { r:  10, g:  14, b:  19 },
};

// â”€â”€ Canvas setup â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
const canvas = document.getElementById('frame-canvas');
const ctx    = canvas.getContext('2d');
let marcoData = null;

// Cargar logo
document.getElementById('logo-overlay').src = LOGO_SRC;

// Cargar marco y leer pÃ­xeles
const marcoImg = new Image();
marcoImg.onload = () => {
  canvas.width  = marcoImg.naturalWidth;
  canvas.height = marcoImg.naturalHeight;
  ctx.drawImage(marcoImg, 0, 0);
  marcoData = ctx.getImageData(0, 0, canvas.width, canvas.height);
  render();
};
marcoImg.src = MARCO_SRC;

// â”€â”€ Utilidades â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
function hexToRgb(hex) {
  return {
    r: parseInt(hex.slice(1,3), 16),
    g: parseInt(hex.slice(3,5), 16),
    b: parseInt(hex.slice(5,7), 16)
  };
}
function dist(r1,g1,b1,r2,g2,b2) {
  return Math.sqrt((r1-r2)**2 + (g1-g2)**2 + (b1-b2)**2);
}
function lum(r,g,b) { return (0.299*r + 0.587*g + 0.114*b) / 255; }

// â”€â”€ Render con recolorizaciÃ³n â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
function render() {
  if (!marcoData) return;

  const tol1    = parseInt(document.getElementById('tol1').value);
  const tol2    = parseInt(document.getElementById('tol2').value);
  const darkMax = parseInt(document.getElementById('tol3').value);
  const c1 = hexToRgb(document.getElementById('color1').value);
  const c2 = hexToRgb(document.getElementById('color2').value);
  const c3 = hexToRgb(document.getElementById('color3').value);

  const src = marcoData.data;
  const out = new Uint8ClampedArray(src.length);

  for (let i = 0; i < src.length; i += 4) {
    const r = src[i], g = src[i+1], b = src[i+2], a = src[i+3];
    out[i+3] = a;
    if (a === 0) { out[i]=out[i+1]=out[i+2]=0; continue; }

    const l = lum(r,g,b);
    const brightness = (r + g + b) / 3;
    const mx = Math.max(r,g,b), mn = Math.min(r,g,b);
    const sat = mx - mn;

    const dCyan = dist(r,g,b, ORIG.cyan.r, ORIG.cyan.g, ORIG.cyan.b);
    const dGray = dist(r,g,b, ORIG.gray.r, ORIG.gray.g, ORIG.gray.b);
    const dDark = dist(r,g,b, ORIG.dark.r, ORIG.dark.g, ORIG.dark.b);

    if (brightness < darkMax && dDark < dGray && dDark < dCyan) {
      // Zona oscura
      const f = Math.min(2.5, l * 5.0 + 0.05);
      out[i]   = Math.min(255, Math.round(c3.r * f));
      out[i+1] = Math.min(255, Math.round(c3.g * f));
      out[i+2] = Math.min(255, Math.round(c3.b * f));
    } else if (dCyan < tol2 && dCyan <= dGray) {
      // Zona cyan
      const f = Math.min(1.8, l * 2.5 + 0.1);
      out[i]   = Math.min(255, Math.round(c2.r * f));
      out[i+1] = Math.min(255, Math.round(c2.g * f));
      out[i+2] = Math.min(255, Math.round(c2.b * f));
    } else if (dGray < tol1) {
      // Zona metÃ¡lica
      const f = Math.min(1.6, l * 2.2 + 0.05);
      out[i]   = Math.min(255, Math.round(c1.r * f));
      out[i+1] = Math.min(255, Math.round(c1.g * f));
      out[i+2] = Math.min(255, Math.round(c1.b * f));
    } else {
      out[i]=r; out[i+1]=g; out[i+2]=b;
    }
  }

  ctx.putImageData(new ImageData(out, canvas.width, canvas.height), 0, 0);

  document.getElementById('swatch1').style.background = document.getElementById('color1').value;
  document.getElementById('swatch2').style.background = document.getElementById('color2').value;
  document.getElementById('swatch3').style.background = document.getElementById('color3').value;
}

// â”€â”€ Eventos controles â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
['color1','color2','color3'].forEach(id =>
  document.getElementById(id).addEventListener('input', render)
);
['tol1','tol2','tol3'].forEach(id => {
  document.getElementById(id).addEventListener('input', () => {
    document.getElementById(id+'-val').textContent = document.getElementById(id).value;
    render();
  });
});

// â”€â”€ Foto â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
function loadPhoto(file) {
  if (!file || !file.type.startsWith('image/')) return;
  const url = URL.createObjectURL(file);
  const img = document.createElement('img');
  img.src = url;
  const layer = document.getElementById('photo-layer');
  layer.querySelectorAll('img').forEach(el => el.remove());
  document.getElementById('upload-hint').style.display = 'none';
  layer.appendChild(img);
}
document.getElementById('photo-input').addEventListener('change', e => loadPhoto(e.target.files[0]));
document.getElementById('editor-wrap').addEventListener('click', () => document.getElementById('photo-input').click());

const wrap = document.getElementById('editor-wrap');
wrap.addEventListener('dragover', e => { e.preventDefault(); wrap.classList.add('dragover'); });
wrap.addEventListener('dragleave', () => wrap.classList.remove('dragover'));
wrap.addEventListener('drop', e => { e.preventDefault(); wrap.classList.remove('dragover'); loadPhoto(e.dataTransfer.files[0]); });

// â”€â”€ Descargar â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
function descargar() {
  const size = canvas.width;
  const tmp  = document.createElement('canvas');
  tmp.width = tmp.height = size;
  const tCtx = tmp.getContext('2d');
  const photoImg = document.querySelector('#photo-layer img');
  if (photoImg) {
    const nw = photoImg.naturalWidth, nh = photoImg.naturalHeight;
    const scale = Math.max(size/nw, size/nh);
    const sw = nw*scale, sh = nh*scale;
    tCtx.drawImage(photoImg, (size-sw)/2, (size-sh)/2, sw, sh);
  } else {
    tCtx.fillStyle = '#111'; tCtx.fillRect(0,0,size,size);
  }
  tCtx.drawImage(canvas, 0, 0);
  const link = document.createElement('a');
  link.download = 'AEMX_perfil.png';
  link.href = tmp.toDataURL('image/png');
  link.click();
}
</script>
